ios/rac-eventbus-rxjava.html.body:
Rac EventBus RxJava
Rac 是什么
Rac 全称 Reactivecocoa，是一个应用于 iOS 和 OS X 开发的框架，它的灵感来自函数式 响应式编程。
Rac 做了什么
将原有的各种设计模式，包括 中心以及观察者模式各种『输入』，都抽象成了信号，通过信号的传递来处理这些行为。简化了事件的传递，每个部分只需要关注信号的传递及状态即可。最终将信号通过不同的组合，达成我们最终的目的。
Rac 的组成
1. 核心组件

信号源
RACStream 及其子类；
订阅者
RACSubscriber及其子类
调度器
RACScheduler及其子类
清洁工
RACDisposable及其子类

2. 组件间的关系

订阅者订阅信号源后，调度器保证信号源的传递及顺序
信号到达后，根据信号的状态，进行不同的操作
操作完成后，通过清洁工清理掉信号源

Rac 的用处

处理异步或者事件驱动数据源
连接依赖的操作
并行地独立地工作
简化集合转换

Rac 的使用
Rac 的简单使用
对比 EventBus RxJava
EventBus
EventBus是一款针对Android设计的发布/订阅事件总线，使用订阅/发布模式让组件间的通信变得简单。主要功能是替代Intent，Handler，BroadCast在Fragment，Activity，Service，线程之间的消息传递。

EventBus 四大组成部分：

Publisher发布者
用于分发我们的Event事件，在EventBus中通过post方法进行分发传送。
Subscriber订阅者
用于接受我们的事件，我们在订阅事件中处理我们接收的数据。
Event事件
任何一个对象都可以作为事件，比如任何字符串，事件是发布者和订阅者之间的通信载体。
EventBus
类似于中转站，将我们的事件进行对应的分发处理。


优点

简化了组件之间的通信
将事件发送者和接收者分离
在Activities，Fragments和background threads中表现良好
避免复杂且容易出错的依赖关系和生命周期问题


使代码更简单
性能开销小
代码量小（约50k左右）


缺点
  消息乱飞？不方便 Debug？

使用

定义一个事件
   public static class MessageEvent
   {
       /* Additional fields if needed */
   }


声明一个用于响应的方法，并且在适当的生命周期注册或注销
   @Subscribe(threadMode = ThreadMode.MAIN)  
   public void onMessageEvent(MessageEvent event)
   {
       /* Do something */
   }
   @Override
   public void onStart() {
       super.onStart();

       // 通过 isRegistered 检查是否已经注册订阅
       if (!EventBus.getDefault().isRegistered(this)) {
           EventBus.getDefault().register(this);
       }
   }

   @Override
   public void onStop() {
       super.onStop();
       EventBus.getDefault().unregister(this);
   }

   根据不同的应用场景，可以选择在不同的声明周期注册或移除订阅
