   {
       super.onPause();
   }


发布事件，事件发布后，订阅者中的响应方法就会受到事件
   EventBus.getDefault().post(new MessageEvent());





RxJava
RxJava 在 GitHub 主页上的自我介绍是"a library for composing asynchronous and event-based programs using observable sequences for the Java VM"（一个在 Java VM 上使用可观测的序列来组成异步的、基于事件的程序的库），核心可以总结为两个字：异步。说到根上，它就是一个实现异步操作的库。而它的异步实现，是通过一种扩展的观察者模式来实现的。

RxJava 的四个基本概念

Observable (可观察者，即被观察者)
   决定什么时候触发事件以及触发怎样的事件。
Observer (观察者)
   决定事件触发的时候将有怎样的行为。
subscribe (订阅)
   创建了 Observable 和 Observer 之后，再用 subscribe() 方法将它们联结起来，整条链子就可以工作了
事件


使用
  Observable.from(folders)

      .flatMap(new Func1>() {
          @Override
          public Observable call(File file) {
              return Observable.from(file.listFiles());
          }
      })

      .filter(new Func1() {
          @Override
          public Boolean call(File file) {
              return file.getName().endsWith(".png");
          }
      })

      .map(new Func1() {
          @Override
          public Bitmap call(File file) {
              return getBitmapFromFile(file);
          }
      })

      .subscribeOn(Schedulers.io())

      .observeOn(AndroidSchedulers.mainThread())

      .subscribe(new Action1() {
          @Override
          public void call(Bitmap bitmap) {
              imageCollectorView.addImage(bitmap);
          }
      });



