ios/gcd.html.body:
GCD 同步异步与串行并行
不论是同步异步，还是串行并行，单独讲一个，意义都不大。在实际开发中，只有将他们进行各式各样的组合，才能更好地完成我们的需求，本篇文章中就会对他们之间的组合进行举例~
名词解释
在学习之前，我们需要先了解一些基础知识：
线程： 程序执行任务的最小调度单位
任务： 我们要完成的工作，可以是一个方法也可以是一个block
队列： 用于保存“任务”的数组
同步执行： 不能开启新线程，任务创建后，必须执行完才可以继续后面的操作
异步执行： 可以开启新线程，任务创建后，可以继续执行后面的操作，不必等待任务完成
串行队列： 底层只维护一个线程，队列中的任务只能串行按顺序执行
并行队列： 底层使用线程池维护多个线程，队列中的任务可以并发执行
实践出真知
当同步异步遇上串行并行会发生什么呢？让我们拭目以待～

同步执行 + 串行队列
  不会开启新线程，所有的任务都在主线程中执行。因为串行队列的原因，任务会按顺序执行。
  dispatch_queue_t queue = dispatch_queue_create("blog.zhangpeng.site", DISPATCH_QUEUE_SERIAL);
  NSLog(@"---start---%@", [NSThread currentThread]);
  dispatch_sync(queue, ^{
      sleep(5);
      NSLog(@"任务1---%@", [NSThread currentThread]);
  });
  dispatch_sync(queue, ^{
      sleep(3);
      NSLog(@"任务2---%@", [NSThread currentThread]);
  });
  dispatch_sync(queue, ^{
      sleep(1);
      NSLog(@"任务3---%@", [NSThread currentThread]);
  });
  NSLog(@"---end---%@", [NSThread currentThread]);

  /**
  控制台输出：
  ---start---{number = 1, name = main}
  任务1---{number = 1, name = main}
  任务2---{number = 1, name = main}
  任务3---{number = 1, name = main}
  ---end---{number = 1, name = main}
  */


同步执行 + 并行队列
  虽然是并行队列，但是因为是同步执行，所以不会开启新线程。因为没有开启新线程，所以所有任务都在主线程执行，所以即使是并行队列，任务也需要按顺序依次执行。
  dispatch_queue_t queue = dispatch_queue_create("blog.zhangpeng.site", DISPATCH_QUEUE_CONCURRENT);
  NSLog(@"---start---%@", [NSThread currentThread]);
  //使用同步函数封装三个任务
  dispatch_sync(queue, ^{
      sleep(5);
      NSLog(@"任务1---%@", [NSThread currentThread]);
  });
  dispatch_sync(queue, ^{
      sleep(3);
      NSLog(@"任务2---%@", [NSThread currentThread]);
  });
  dispatch_sync(queue, ^{
      sleep(1);
      NSLog(@"任务3---%@", [NSThread currentThread]);
  });
  NSLog(@"---end---%@", [NSThread currentThread]);

  /**
  ---start---{number = 1, name = main}
  任务1---{number = 1, name = main}
  任务2---{number = 1, name = main}
  任务3---{number = 1, name = main}
  ---end---{number = 1, name = main}
  */


异步执行 + 串行队列
  因为是异步执行，所以开启了新的线程，因为是串行队列，所以任务在新的线程中按顺序执行。
  dispatch_queue_t queue = dispatch_queue_create("blog.zhangpeng.site", DISPATCH_QUEUE_SERIAL);
  NSLog(@"---start---%@", [NSThread currentThread]);
  dispatch_async(queue, ^{
      sleep(5);
      NSLog(@"任务1---%@", [NSThread currentThread]);
  });
  dispatch_async(queue, ^{
      sleep(3);
      NSLog(@"任务2---%@", [NSThread currentThread]);
  });
  dispatch_async(queue, ^{
      sleep(1);
      NSLog(@"任务3---%@", [NSThread currentThread]);
  });
  NSLog(@"---end---%@", [NSThread currentThread]);

  /**
  ---start---{number = 1, name = main}
  ---end---{number = 1, name = main}
  任务1---{number = 3, name = (null)}
  任务2---{number = 3, name = (null)}
  任务3---{number = 3, name = (null)}
  */


异步执行 + 并行队列
  因为是异步执行，所以开启了新的线程，因为是并行队列，所以任务可以不按顺序执行。因此在这种组合模式下，可以开启多条线程。
  dispatch_queue_t queue = dispatch_queue_create("blog.zhangpeng.site", DISPATCH_QUEUE_CONCURRENT);
  NSLog(@"---start---%@", [NSThread currentThread]);
  dispatch_async(queue, ^{
      sleep(5);
      NSLog(@"任务1---%@", [NSThread currentThread]);
  });
  dispatch_async(queue, ^{
      sleep(3);
      NSLog(@"任务2---%@", [NSThread currentThread]);
  });
  dispatch_async(queue, ^{
      sleep(1);
      NSLog(@"任务3---%@", [NSThread currentThread]);
  });
  NSLog(@"---end---%@", [NSThread currentThread]);

  /**
  ---start---{number = 1, name = main}
  ---end---{number = 1, name = main}
  任务3---{number = 3, name = (null)}
  任务2---{number = 4, name = (null)}
  任务1---{number = 5, name = (null)}
  */


同步执行 + 主队列
  死锁。任务1需要等待主队列中所有的任务都执行完毕才可以执行，但是因为是同步执行，要执行完任务1才能执行主队列中的其他任务，最后互相等待，造成了死锁。这边其实与任务2和任务3并没有什么关系。QAQ，不知道为什么其他人的博客都说和任务2和3有关。
  dispatch_queue_t queue = dispatch_get_main_queue();
  NSLog(@"---start---%@", [NSThread currentThread]);
  dispatch_sync(queue, ^{
      sleep(5);
      NSLog(@"任务1---%@", [NSThread currentThread]);
  });
  dispatch_sync(queue, ^{
      sleep(3);
      NSLog(@"任务2---%@", [NSThread currentThread]);
  });
  dispatch_sync(queue, ^{
      sleep(1);
      NSLog(@"任务3---%@", [NSThread currentThread]);
  });
  NSLog(@"---end---%@", [NSThread currentThread]);

  /**
  ---start---{number = 1, name = main}
  */


异步执行 + 主队列
  虽然是异步执行，但是主队列中的任务是在主线程中执行，因此没有开启新的线程执行任务，任务按顺序执行。
  dispatch_queue_t queue = dispatch_get_main_queue();
  NSLog(@"---start---%@", [NSThread currentThread]);
  dispatch_async(queue, ^{
      sleep(5);
      NSLog(@"任务1---%@", [NSThread currentThread]);
  });
  dispatch_async(queue, ^{
      sleep(3);
      NSLog(@"任务2---%@", [NSThread currentThread]);
  });
  dispatch_async(queue, ^{
      sleep(1);
      NSLog(@"任务3---%@", [NSThread currentThread]);
  });
  NSLog(@"---end---%@", [NSThread currentThread]);

  /**
  ---start---{number = 1, name = main}
  ---end---{number = 1, name = main}
  任务1---{number = 1, name = main}
  任务2---{number = 1, name = main}
  任务3---{number = 1, name = main}
  */



结
上面简单的对同步异步执行与串行并行队列的几种组合方式进行了举例，而我们的日常工作中要比上述举例复杂的多，但是本质还是不变的，我们一定可以找到一种合理的组合方式解决我们遇上的问题的。


